import React from 'react';

import NavigationItem from './NavigationItem';

const rightItems =( props )=>{
  return(
    <ul>

      <NavigationItem
        link="/login"
        exact
      >
      Login
      </NavigationItem>

    </ul>
  );
};

export default rightItems;
